import { NavLink, Outlet } from "react-router-dom";
import { getProjects } from "../ProjectInfo";

function Projects() {
    let projects = getProjects();
    return (
        <>
            <h1>Projects Content</h1>
            <nav>
                {projects.map(el => (
                    <NavLink 
                        style={(isACtive) => {
                            return {
                                display: "block",
                                margin: "1rem 0",
                                color: isActive ? "red" : "",
                            };
                        }}
                        to={`/projects/${el.pid}`} 
                        key={el.pid}
                    >
                        {el.client} 
                    </NavLink>
                ))}
            </nav>
            <Outlet />
        </>
    );
}

export default Projects;
